import React from 'react'

const BookingDetail = (props) => {

    const onDelete=()=> {
        props.handdleDelete(props.booking.id)
    }

    const onEdit=() => {
        props.handleEdit(props.booking.id)
    }

    if(!props.Booking){
        return null
    }

    return(
        <div>
            <div className="booking-item-basic-details">
                <h4>Booking Basic Info:</h4>
                <h6>Id: {props.booking.id}</h6>
                <h6>Date: {props.booking.date}</h6>
                <h6>Cost: {props.booking.totalCost}</h6>
                <h6>Status: {props.booking.status}</h6>   
                <h6>Remarks: {props.booking.date}</h6>            
            </div>
            <div className="booking-item-customer-detail">
                <h4>Customer Info:</h4>
                <h6>FirstName: {props.booking.firstName}</h6>
                <h6>Surname: {props.booking.surname}</h6>
                <h6>Surname: {props.booking.surname}</h6>
           </div>


        </div>

    )
}
